import React from "react";
import Login from "./Login";

let isLoggedIn = true;

const currentTime = new Date().getHours();


function App() {
  return (
    <div className="container">

     {isLoggedIn ? <h1>Hello</h1> : <Login/>}

    {currentTime > 17 ? <h1>Why are you working</h1> : <h1>Work Hard! is just {currentTime} pm.</h1>}

    </div>
  );
}

export default App;
